import React from "react";
import { useCart } from "../../context/CartContext";

export default function MyCart() {
  const { cart, removeFromCart, clearCart } = useCart();

  const subtotal = cart.reduce(
    (sum, item) => sum + item.price * item.quantity,
    0
  );

  return (
    <div className="max-w-6xl mx-auto p-6">
      <h2 className="text-2xl font-bold mb-8">üõí My Cart</h2>

      {cart.length === 0 ? (
        <div className="text-center py-20 border rounded-2xl">
          <p className="text-lg mb-3">Your cart is empty</p>
          <span className="text-5xl">üõçÔ∏è</span>
        </div>
      ) : (
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">

          {/* CART ITEMS */}
          <div className="lg:col-span-2 space-y-6">
            {cart.map((item) => (
              <div
                key={`${item.id}-${item.size}`}
                className="flex gap-6 p-5 border rounded-2xl bg-white shadow-sm"
              >
                {/* IMAGE - LEFT (FIXED SIZE LIKE PRODUCT PAGE) */}
                <div className="w-36 h-44 flex-shrink-0 rounded-xl overflow-hidden border">
                  <img
                    src={item.image || item.images?.[0]}
                    alt={item.name}
                    className="w-full h-full object-cover"
                  />
                </div>

                {/* DETAILS - RIGHT */}
                <div className="flex-1">
                  <h3 className="text-xl font-semibold mb-1">
                    {item.name}
                  </h3>

                  {item.description && (
                    <p className="text-sm text-gray-600 mb-2 line-clamp-2">
                      {item.description}
                    </p>
                  )}

                  <p className="text-sm text-gray-500 mb-1">
                    Size: <span className="font-medium">{item.size}</span>
                  </p>

                  <p className="text-sm text-gray-500 mb-3">
                    Price: ‚Çπ{item.price}
                  </p>

                  <div className="flex items-center justify-between">
                    <p className="font-semibold text-lg">
                      ‚Çπ{item.price * item.quantity}
                    </p>

                    <button
                      onClick={() => removeFromCart(item.id)}
                      className="text-sm text-red-600 hover:underline"
                    >
                      Remove
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {/* ORDER SUMMARY */}
          <div className="border rounded-2xl p-6 h-fit bg-white shadow-sm">
            <h3 className="text-lg font-semibold mb-5">Order Summary</h3>

            <div className="flex justify-between mb-3">
              <span className="text-gray-600">Subtotal</span>
              <span>‚Çπ{subtotal}</span>
            </div>

            <div className="flex justify-between mb-3 text-gray-500">
              <span>Shipping</span>
              <span>Free</span>
            </div>

            <hr className="my-4" />

            <div className="flex justify-between font-semibold text-lg">
              <span>Total</span>
              <span>‚Çπ{subtotal}</span>
            </div>

            <button className="mt-6 w-full bg-black text-white py-3 rounded-xl hover:opacity-90">
              Proceed to Checkout
            </button>

            <button
              onClick={clearCart}
              className="mt-4 w-full text-sm text-gray-500 hover:underline"
            >
              Clear Cart
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
